import React from "react";
import "./WeatherCard.css";

const WeatherCard = props => {

  const weatherForecast = props.weatherForecast;

    weatherForecast.forEach((day, index) => {
      return(
        <div className="ui card" id="card">
          <div className="image">
              `${props.weatherForecast[index].day.condition.icon}`

            <img src="semantic-ui icon" alt="Weather Icon" />
          </div>
          <div className="content">
            props.weatherForecast[index].date
            Current Conditions: props.weatherForecast[index].day.condition.text

            <div className="meta">
              <p className="header">
                <span>High/Low:
                  props.weatherForecast[index].day.maxtemp_f / props.weatherForecast[index].day.mintemp_f
                </span>
              </p>

            </div>
            <div className="description">

            </div>
          </div>
        </div>
      );
    })
}

export default WeatherCard;
